from datetime import datetime
import traceback
import mimetypes


def load_json(file_name):
    with open(file_name, 'r') as f:
        return json.load(f)

def load_cookies(filename):
    with open(filename, 'r') as f:
        cookies = json.load(f)

    for cookie in cookies:
        # 如果 cookie 的 expiry 是 "session" 或者 "会话"，则设置为 None
        if 'expiry' in cookie and (cookie['expiry'] == 'session' or cookie['expiry'] == '会话'):
            cookie['expiry'] = None
        elif 'expiry' in cookie and isinstance(cookie['expiry'], str):
            try:
                # 尝试将 ISO 8601 格式的日期转换为 Unix 时间戳
                cookie['expiry'] = int(datetime.fromisoformat(cookie['expiry'].replace("Z", "+00:00")).timestamp())
            except ValueError:
                print(f"Error converting expiry for cookie: {cookie['name']}")
                cookie['expiry'] = None  # 如果转换失败，设置为 None
                
    return cookies


def add_cookies(driver, cookies):
    for cookie in cookies:
        try:
            # 删除不支持的属性（例如 size）
            cookie.pop('size', None)

            # Selenium 对于 sameSite 的处理可能会不一致，我们可以尝试忽略 sameSite 属性
            cookie.pop('sameSite', None)

            # print(f"Adding cookie: {cookie}")
            driver.add_cookie(cookie)
        except Exception as e:
            print(f"Error adding cookie: {cookie['name']}, Error: {e}")



def setup_driver():
    options = Options()
    options.add_argument("--headless")
    options.add_argument("--no-sandbox")
    options.add_argument("--disable-gpu")
    options.add_argument("--start-maximized")
    options.add_argument("--enable-font-antialiasing")
    options.add_argument("--enable-webfonts")
    options.add_argument("user-agent=Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.124 Safari/537.36")

    service = Service(executable_path='/usr/local/bin/chromedriver-linux64/chromedriver')
    driver = webdriver.Chrome(service=service, options=options)
    return driver

def download_image(image_url, folder, suffix):
    if not os.path.exists(folder):
        os.makedirs(folder)

    try:
        response = requests.get(image_url)
        if response.status_code == 200:
            content_type = response.headers['Content-Type']
            ext = mimetypes.guess_extension(content_type) or ".jpg"
            # 为图片文件名添加后缀，防止文件名冲突
            filename_base = os.path.join(folder, os.path.basename(image_url).split('?')[0])
            filename = f"{filename_base}_{suffix}{ext}"
            with open(filename, 'wb') as file:
                file.write(response.content)
            return filename
        else:
            print(f"Failed to download image. Status code: {response.status_code}")
            return None
    except Exception as e:
        print(f"Error downloading image: {e}")
        return None

def remove_duplicates(comments, description):
    # 去除与描述相同的评论并且去除空评论
    unique_comments = set(comments)
    # 去除与文案描述相同的评论内容，并且过滤掉空评论
    cleaned_comments = [
        comment for comment in unique_comments 
        if comment.strip() != description.strip() and comment.strip() != ""
    ]
    return cleaned_comments


def scrape_page(driver, url, output_folder):
    driver.get(url)

    cookies = load_cookies("cookie_xhs.json")
    add_cookies(driver, cookies)
    # print(f"Loaded cookies: {cookies}")  # 确认 cookie 已加载

    # 刷新页面以登录
    driver.refresh()
    time.sleep(20)
    driver.save_screenshot("login_check.png")  # 检查登录状态
    
    data = {}
    try:    

        # 获取文案内容
        title_element = driver.find_element(By.CSS_SELECTOR, "#detail-title")
        desc_element = driver.find_element(By.CSS_SELECTOR, "#detail-desc")
        date_element = driver.find_element(By.CSS_SELECTOR, ".date")

        data["title"] = title_element.text if title_element else "N/A"
        data["description"] = desc_element.text if desc_element else "N/A"
        data["date"] = date_element.text if date_element else "N/A"

        # 点击评论区的按钮
        try:
            # 尝试直接通过 Selenium 获取元素并点击
            comment_button = driver.find_element(By.CSS_SELECTOR, 'span.chat-wrapper svg')
            comment_button.click()
        except NoSuchElementException:
            print("未找到评论按钮")

        time.sleep(10)  # 等待评论区加载
        driver.save_screenshot("login_check.png")  # 检查登录状态

        try:
            # 找到包含评论的容器
            comments_container = WebDriverWait(driver, 10).until(
                EC.presence_of_element_located((By.CSS_SELECTOR, "div.list-container"))
            )
            i = 0
        
            while i < 10:
                # 使用 JavaScript 滚动评论区域的每个 comment-item
                comment_items = driver.find_elements(By.CSS_SELECTOR, "div.parent-comment div.comment-item")
                if not comment_items:
                    print("未找到评论项，退出")
                    break

                # 滚动到页面的最后一个评论项
                last_comment = comment_items[-1]
                driver.execute_script("arguments[0].scrollIntoView(true);", last_comment)
                time.sleep(3)  # 等待评论加载
                i +=1

                # 检查是否到达评论区的结尾
                try:
                    driver.find_element(By.CSS_SELECTOR, "div.end-container")
                    driver.save_screenshot("login_check.png")  # 检查登录状态

                    print("All comments loaded.")
                    break
                except NoSuchElementException:
                    pass
        except TimeoutException:
            print("评论区加载超时")
        except Exception as e:
            print(f"滚动评论时出错: {e}")

        
        # 获取所有评论的内容
        comments = driver.find_elements(By.CSS_SELECTOR, "div.parent-comment div.comment-inner-container div.content")[:20]
        comment_texts = [comment.text for comment in comments]

        # 去除与描述重复的评论及重复内容
        data["comments"] = remove_duplicates(comment_texts, data.get("description", ""))

    except (NoSuchElementException, TimeoutException) as e:
        print(f"Error scraping page: {e}")
        traceback.print_exc()  # 打印详细错误信息

    # 等待父元素加载完毕
    swiper_wrapper = WebDriverWait(driver, 20).until(
        EC.presence_of_element_located((By.CSS_SELECTOR, "div.swiper-wrapper"))
    )

    # 从父元素中提取所有图片的URL
    images = swiper_wrapper.find_elements(By.CSS_SELECTOR, "img.note-slider-img")
    image_urls = []
    for i, img in enumerate(images):
        src = img.get_attribute("src")
        if src not in image_urls:
            image_urls.append(src)
            image_path = download_image(src, output_folder, i)
            if image_path:
                data.setdefault("image", []).append(image_path)

    return data

def save_json(data, output_file):
    with open(output_file, 'w', encoding='utf-8') as f:
        json.dump(data, f, ensure_ascii=False, indent=4)

def process_links(links, output_folder, start_index=0):
    driver = setup_driver()
    for index, link in enumerate(links[start_index:], start=start_index):
        print(f"Processing link {index + 1}/{len(links)}: {link}")
        try:
            data = scrape_page(driver, link, output_folder)
            output_file = os.path.join(output_folder, f"output_{index + 1}.json")
            save_json(data, output_file)
            print(f"Data saved to {output_file}")
        except Exception as e:
            print(f"Error processing link {link}: {e}")
    
    driver.quit()

